import "../Signin.css"
import { AiFillEye,AiFillEyeInvisible } from 'react-icons/ai';
import { useState } from "react";

const SignIn = () => {


  const [pass,setPass] = useState("")
  const [passHidden,setPassHidden] = useState(true)
  return (
    <div className="signIn formContainer">


      <h1>
        Sign In
      </h1>

      <form action="" className="form">
        <h4>
        Email
        </h4>
        <div className="input">


        <input type="email" style={{"fontSize":"1rem","padding":"0rem 0.5rem"}} />
        </div>

        <h4>
          Password
        </h4>
        <div className="input pass">
          {
            passHidden?

        <input type="password" style={{"fontSize":"1rem","padding":"0rem 0.5rem"}} value={pass} onChange = {(e)=>{

          setPass(e.target.value)

        }}
        />:
        <input type="text" style={{"fontSize":"1rem","padding":"0rem 0.5rem"}} value={pass} onChange = {(e)=>{

          setPass(e.target.value)

        }}

        />

      }
      {
        passHidden?

        <AiFillEye className="icon" size ={25} onClick = {()=>{setPassHidden(false)}}/>:

        <AiFillEyeInvisible className="icon" size ={25} onClick = {()=>{setPassHidden(true)} }/>
      }
        </div>


      <div className="fLinks">


        <a href="">
          Forgot your passowrd?
        </a>
        <a href="">
          Sign Up Now
        </a>

        </div>

        <div className="buttonWrapper">
          <button className="btn">
            Sign In
          </button>
        </div>


      </form>
    </div>

  )
}

export default SignIn
